import App from 'next/app';
import Layout from '../components/Layout';
class SushiMaster extends App {
  render() {
    const { Component, pageProps } = this.props;
    return (
      <Layout>
        <Component {...pageProps}>
          <div className="appdiv"></div>
        </Component>
      </Layout>
    );
  }
}

export default SushiMaster;

